import React, { Component } from 'react';
import {Departments} from "./Entities/Departments.js";

export default class App extends Component {
    static displayName = App.name;

    constructor(props) {
        super(props);
        this.state = { forecasts: [], loading: true };
    }

    componentDidMount() {
        this.populateDepartmentsData();
    }

    static renderDepartmentsTable(departments) {
        return (
           <Departments/>
        );
    }

    render() {
        let contents = this.state.loading
            ? <p><em>Loading... Please refresh once the ASP.NET backend has started. See <a href="https://aka.ms/jspsintegrationreact">https://aka.ms/jspsintegrationreact</a> for more details.</em></p>
            : App.renderDepartmentsTable(this.state.departments);

        return (
            <div>
                <h1 id="tabelLabel" >Weather forecast</h1>
                <p>This component demonstrates fetching data from the server.</p>
                {contents}
            </div>
        );
    }

    async populateDepartmentsData() {
        const response = await fetch('https://localhost:7049/api/departments/getdepartments');
        const data = await response.json();
        this.setState({ departments: data, loading: false });
    }
}
